<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>HI</title>
    <style>
        * {
            margin: 0;
            padding: 0;
        }
        body {
            background: linear-gradient(to bottom, #d7ff6a, #acff75, #91f6ff);
            perspective: 1000px;
            display: flex;
            height: 100vh;
            flex-direction: column;
        }
        .wrap {
            flex: 1;
            display: flex;
            justify-content: center;
            align-items: center;
        }
        .cube {
            width: 200px;
            height: 200px;
            position: absolute;
            transform-style: preserve-3d;
            transform: rotateY(0deg) rotateX(-45deg) rotateZ(-45deg);
            animation: cube 4s linear infinite;
        }

        .cube:hover {
            animation: cube 8s linear infinite;
        }

        .cube:hover .side img {
            filter: opacity(70%);
            transform: translateZ(250px);
        }

        img {
            width: 100%;
            height: 100%;
            transition: all 1s ease-out 0s;
        }

        .cube .side {
            width: 100%;
            height: 100%;
            text-align: center;
            position: absolute;
            transform-style: preserve-3d;
        }

        .cube .side2 {
            width: 50%;
            height: 50%;
            position: absolute;
            top: 50px;
            left: 50px;
            transform-style: preserve-3d;
        }

        .cube .front {
            transform: rotateY(0deg) translateZ(100px);
        }

        .cube .back {
            transform: rotateY(180deg) translateZ(100px);
        }

        .cube .left {
            transform: rotateY(-90deg) translateZ(100px);
        }

        .cube .right {
            transform: rotateY(90deg) translateZ(100px);
        }

        .cube .top {
            transform: rotateX(90deg) translateZ(100px);
        }

        .cube .bottom {
            transform: rotateX(-90deg) translateZ(100px);
        }

        .cube .side2.front {
            transform: rotateY(0deg) translateZ(50px);
        }

        .cube .side2.back {
            transform: rotateY(180deg) translateZ(50px);
        }

        .cube .side2.left {
            transform: rotateY(-90deg) translateZ(50px);
        }

        .cube .side2.right {
            transform: rotateY(90deg) translateZ(50px);
        }

        .cube .side2.top {
            transform: rotateX(90deg) translateZ(50px);
        }

        .cube .side2.bottom {
            transform: rotateX(-90deg) translateZ(50px);
        }

        @keyframes cube {
            0% {
                transform: rotateY(0deg) rotateX(-45deg) rotateZ(-30deg);
            }

            100% {
                transform: rotateY(360deg) rotateX(-45deg) rotateZ(-30deg);
            }
        }
    </style>
</head>
